import React, { useState } from "react";

function Quetions(props) {
  return (
    <div>
      <h1>Which of the following is not a keyword?</h1>
      <input type="radio" value="eval" />
      <label for="eval">eval</label>
      <input type="radio" value="assert" />
      <label>assert</label>

      {/* <input type="radio">assert</input>
      <input type="radio">nonlocal</input>
      <input type="radio">pass</input> */}
    </div>
  );
}

export default Quetions;
